// creates the square boxes that link to a given page using semantic-ui styling 

// imports 
import React from 'react';
import { Grid, Image, Input, Menu } from "semantic-ui-react";

import book from "./images/joke-book.png"; 
import feed from "./images/public-feed.png"; 
import favorites from "./images/favorites.png"; 
import friends from "./images/friends.png"; 
import profile from "./images/profile.png"; 
// import inbox from "./images/inbox.png"; 

const HomePageGrid = () => {
    return (
        <div className="home-grid">

            <Menu.Item>
                <Input icon='search' placeholder='Search joke...' />
            </Menu.Item>

            <Grid>
                <Grid.Column className="joke-book">
                    <Image src={book}/>
                </Grid.Column>

                <Grid.Column className="public-feed">
                    <Image src={feed} />
                </Grid.Column>

                <Grid.Column className="favorites">
                    <Image src={favorites} />
                </Grid.Column>

                <Grid.Column className="friends">
                    <img src={friends} />   
                </Grid.Column>

                {/* <Grid.Column className="inbox">
                    <Image src={inbox} />
                </Grid.Column> */}

                <Grid.Column className="profile">
                    <Image src={profile} />
                </Grid.Column>
            </Grid>

        </div>
    );   
};

export default HomePageGrid;
